import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { LoginComponent } from './Authorities/login/login.component';
import { EnquiryComponent } from './Components/enquiry/enquiry.component';
import { AboutUsComponent } from './Components/about-us/about-us.component';
import { LocationComponent } from './Components/location/location.component';
import { ContactUsComponent } from './Components/contact-us/contact-us.component';
import { CustomerRelationshipManagerComponent } from './Authorities/customer-relationship-manager/customer-relationship-manager.component';
import { OperationalExecutiveComponent } from './Authorities/operational-executive/operational-executive.component';
import { CreditManagerComponent } from './Authorities/credit-manager/credit-manager.component';
import { AccountHeadComponent } from './Authorities/account-head/account-head.component';
import { HomeComponent } from './Components/home/home.component';
import { HomeHeaderComponent } from './Components/home-header/home-header.component';
import { DashHeaderComponent } from './Components/dash-header/dash-header.component';
import { DashboardComponent } from './Components/dashboard/dashboard.component';
import { ReactiveFormsModule } from '@angular/forms';
import { EMICalculatorComponent } from './Components/emi-calculator/emi-calculator.component';


@NgModule({
  declarations: [
    AppComponent,
    LoginComponent,
    EnquiryComponent,
    AboutUsComponent,
    LocationComponent,
    ContactUsComponent,
    CustomerRelationshipManagerComponent,
    OperationalExecutiveComponent,
    CreditManagerComponent,
    AccountHeadComponent,
    HomeComponent,
    HomeHeaderComponent,
    DashHeaderComponent,
    DashboardComponent,
    EMICalculatorComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    ReactiveFormsModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
